import React from "react";
import DayPickerInput from 'react-day-picker/DayPickerInput';
import { DataGrid, ColDef, ValueGetterParams } from '@material-ui/data-grid';
import 'react-day-picker/lib/style.css';










import PropTypes from 'prop-types';
import clsx from 'clsx';
import { lighten, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TablePagination from '@material-ui/core/TablePagination';
import TableRow from '@material-ui/core/TableRow';
import TableSortLabel from '@material-ui/core/TableSortLabel';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Paper from '@material-ui/core/Paper';
import Checkbox from '@material-ui/core/Checkbox';
import IconButton from '@material-ui/core/IconButton';
import Tooltip from '@material-ui/core/Tooltip';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Switch from '@material-ui/core/Switch';
import DeleteIcon from '@material-ui/icons/Delete';
import FilterListIcon from '@material-ui/icons/FilterList';

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Donut', 452, 25.0, 51, 4.9),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
  createData('Honeycomb', 408, 3.2, 87, 6.5),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Jelly Bean', 375, 0.0, 94, 0.0),
  createData('KitKat', 518, 26.0, 65, 7.0),
  createData('Lollipop', 392, 0.2, 98, 0.0),
  createData('Marshmallow', 318, 0, 81, 2.0),
  createData('Nougat', 360, 19.0, 9, 37.0),
  createData('Oreo', 437, 18.0, 63, 4.0),
];

function descendingComparator(a, b, orderBy) {
  if (b[orderBy] < a[orderBy]) {
    return -1;
  }
  if (b[orderBy] > a[orderBy]) {
    return 1;
  }
  return 0;
}

function getComparator(order, orderBy) {
  return order === 'desc'
    ? (a, b) => descendingComparator(a, b, orderBy)
    : (a, b) => -descendingComparator(a, b, orderBy);
}

function stableSort(array, comparator) {
  const stabilizedThis = array.map((el, index) => [el, index]);
  stabilizedThis.sort((a, b) => {
    const order = comparator(a[0], b[0]);
    if (order !== 0) return order;
    return a[1] - b[1];
  });
  return stabilizedThis.map((el) => el[0]);
}

const headCells = [
  { id: 'name', numeric: false, disablePadding: true, label: 'Dessert (100g serving)' },
  { id: 'calories', numeric: true, disablePadding: false, label: 'Calories' },
  { id: 'fat', numeric: true, disablePadding: false, label: 'Fat (g)' },
  { id: 'carbs', numeric: true, disablePadding: false, label: 'Carbs (g)' },
  { id: 'protein', numeric: true, disablePadding: false, label: 'Protein (g)' },
];

function EnhancedTableHead(props) {
  const { classes, onSelectAllClick, order, orderBy, numSelected, rowCount, onRequestSort } = props;
  const createSortHandler = (property) => (event) => {
    onRequestSort(event, property);
  };

  return (
    <TableHead>
      <TableRow>
        <TableCell padding="checkbox">
          <Checkbox
            indeterminate={numSelected > 0 && numSelected < rowCount}
            checked={rowCount > 0 && numSelected === rowCount}
            onChange={onSelectAllClick}
            inputProps={{ 'aria-label': 'select all desserts' }}
          />
        </TableCell>
        {headCells.map((headCell) => (
          <TableCell
            key={headCell.id}
            align={headCell.numeric ? 'right' : 'left'}
            padding={headCell.disablePadding ? 'none' : 'default'}
            sortDirection={orderBy === headCell.id ? order : false}
          >
            <TableSortLabel
              active={orderBy === headCell.id}
              direction={orderBy === headCell.id ? order : 'asc'}
              onClick={createSortHandler(headCell.id)}
            >
              {headCell.label}
              {orderBy === headCell.id ? (
                <span className={classes.visuallyHidden}>
                  {order === 'desc' ? 'sorted descending' : 'sorted ascending'}
                </span>
              ) : null}
            </TableSortLabel>
          </TableCell>
        ))}
      </TableRow>
    </TableHead>
  );
}

EnhancedTableHead.propTypes = {
  classes: PropTypes.object.isRequired,
  numSelected: PropTypes.number.isRequired,
  onRequestSort: PropTypes.func.isRequired,
  onSelectAllClick: PropTypes.func.isRequired,
  order: PropTypes.oneOf(['asc', 'desc']).isRequired,
  orderBy: PropTypes.string.isRequired,
  rowCount: PropTypes.number.isRequired,
};

const useToolbarStyles = makeStyles((theme) => ({
  root: {
    paddingLeft: theme.spacing(2),
    paddingRight: theme.spacing(1),
  },
  highlight:
    theme.palette.type === 'light'
      ? {
          color: theme.palette.secondary.main,
          backgroundColor: lighten(theme.palette.secondary.light, 0.85),
        }
      : {
          color: theme.palette.text.primary,
          backgroundColor: theme.palette.secondary.dark,
        },
  title: {
    flex: '1 1 100%',
  },
}));

const EnhancedTableToolbar = (props) => {
  const classes = useToolbarStyles();
  const { numSelected } = props;

  return (
    <Toolbar
      className={clsx(classes.root, {
        [classes.highlight]: numSelected > 0,
      })}
    >
      {numSelected > 0 ? (
        <Typography className={classes.title} color="inherit" variant="subtitle1" component="div">
          {numSelected} selected
        </Typography>
      ) : (
        <Typography className={classes.title} variant="h6" id="tableTitle" component="div">
          Nutrition
        </Typography>
      )}

      {numSelected > 0 ? (
        <Tooltip title="Delete">
          <IconButton aria-label="delete">
            <DeleteIcon />
          </IconButton>
        </Tooltip>
      ) : (
        <Tooltip title="Filter list">
          <IconButton aria-label="filter list">
            <FilterListIcon />
          </IconButton>
        </Tooltip>
      )}
    </Toolbar>
  );
};

EnhancedTableToolbar.propTypes = {
  numSelected: PropTypes.number.isRequired,
};

const useStyles = makeStyles((theme) => ({
  root: {
    width: '100%',
  },
  paper: {
    width: '100%',
    marginBottom: theme.spacing(2),
  },
  table: {
    minWidth: 750,
  },
  visuallyHidden: {
    border: 0,
    clip: 'rect(0 0 0 0)',
    height: 1,
    margin: -1,
    overflow: 'hidden',
    padding: 0,
    position: 'absolute',
    top: 20,
    width: 1,
  },
}));




export default class Dashboard extends React.Component {

  
  state = { Show: false, Showing: false};
  show = () => { if (this.state.Showing) return;

    this.setState({ Show: true, Showing: true });
    setTimeout(() => {
      this.setState({ Show: false, Showing: false });
    }, 3000);
  };

  
  constructor(props){
    super(props);

    this.state = {       
            email: '',      
            password:'',
            users: [],
            email_error:'', 
            email_color:'black', 
            pass_error:'',
            pass_color:'black', 
            redirect: false,
            message:'',
            pop:'',    
            selectedDay: undefined,
    };
    this.handleDayChange = this.handleDayChange.bind(this);
  
  }

  
  handleDayChange(day) {
    this.setState({ selectedDay: day });
  }

  componentDidMount() { }
  render() {
    return (
      <>
     
     



						<div class="kt-container  kt-container--fluid  kt-grid__item kt-grid__item--fluid">
							<div class="row">
								<div class="col-md-12">

								
									<div class="kt-portlet">
										

								
										<form class="kt-form">
											<div class="kt-portlet__body">
												
                        <div class="row"> 
                              <div class="col-md-3">  
                                <div class="form-group">
                                  <label>First Name</label>
                                  <input type="email" class="form-control" aria-describedby="emailHelp" placeholder="Enter First Name"/>
                                  <span class="form-text text-muted">We'll never share your email with anyone else.</span>
                                </div>
                              </div>
                              
                              <div class="col-md-3">  
                                <div class="form-group">
                                  <label>Last Name</label>
                                  <input type="email" class="form-control" aria-describedby="emailHelp" placeholder="Enter Last Name"/>
                                  <span class="form-text text-muted">We'll never share your email with anyone else.</span>
                                </div>
                              </div>
                              
                              <div class="col-md-3">  
                                <div class="form-group">
                                  <label>D.O.B</label>
                                 
                                  <div class="input-group date">
                                      <DayPickerInput
                                            style={{"width": "250px"}}
                                            class="form-control" 
                                            onChange={this.myChangeHandler}
                                            formatDate={formatDate}  
                                            format='dd/MM/yyyy'
                                            placeholder="DD/MM/YYYY"
                                            onDayChange={e =>{
                                              var date = new Date(e);
                                              let mnth = ("0" + (date.getMonth() + 1)).slice(-2),
                                              day = ("0" + date.getDate()).slice(-2);
                                              let dob=[day, mnth , date.getFullYear()].join("/");
                                              this.setState({dob: dob})
                                            }}
                                      />
                                  </div>

                                 
                                  
                                  <span class="form-text text-muted">We'll never share your email with anyone else.</span>

                                </div>
                              </div>
                              
                              <div class="col-md-3">  
                                <div class="form-group">
                                  <label>Gender</label>
                                  <input type="email" class="form-control" aria-describedby="emailHelp" placeholder="Enter email"/>
                                  <span class="form-text text-muted">We'll never share your email with anyone else.</span>
                                </div>
                              </div>
                        </div>

                        <div class="row"> 
                              <div class="col-md-3">  
                                <div class="form-group">
                                  <label>MRN Root</label>
                                  <input type="email" class="form-control" aria-describedby="emailHelp" placeholder="Enter MRN Root"/>
                                  <span class="form-text text-muted">We'll never share your email with anyone else.</span>
                                </div>
                              </div>
                              
                              <div class="col-md-3">  
                                <div class="form-group">
                                  <label> MRN Extension</label>
                                  <input type="email" class="form-control" aria-describedby="emailHelp" placeholder="Enter MRN Extension"/>
                                  <span class="form-text text-muted">We'll never share your email with anyone else.</span>
                                </div>
                              </div>
                              
                              <div class="col-md-3">  
                                <div class="form-group">
                                  <label>Start Date</label>
                                  <div class="input-group date">
                                      <DayPickerInput
                                            style={{"width": "250px"}}
                                            class="form-control" 
                                            onChange={this.myChangeHandler}
                                            formatDate={formatDate}  
                                            format='dd/MM/yyyy'
                                            placeholder="DD/MM/YYYY"
                                            onDayChange={e =>{
                                              var date = new Date(e);
                                              let mnth = ("0" + (date.getMonth() + 1)).slice(-2),
                                              day = ("0" + date.getDate()).slice(-2);
                                              let dob=[day, mnth , date.getFullYear()].join("/");
                                              this.setState({startdate: dob})
                                            }}
                                      />
                                  </div>
                                  <span class="form-text text-muted">We'll never share your email with anyone else.</span>
                                </div>
                              </div>
                              
                              <div class="col-md-3">  
                                <div class="form-group">
                                  <label>End Date</label>
                                  <div class="input-group date">
                                      <DayPickerInput
                                            style={{"width": "250px"}}
                                            class="form-control" 
                                            onChange={this.myChangeHandler}
                                            formatDate={formatDate}  
                                            format='dd/MM/yyyy'
                                            placeholder="DD/MM/YYYY"
                                            onDayChange={e =>{
                                              var date = new Date(e);
                                              let mnth = ("0" + (date.getMonth() + 1)).slice(-2),
                                              day = ("0" + date.getDate()).slice(-2);
                                              let dob=[day, mnth , date.getFullYear()].join("/");
                                              this.setState({enddate: dob})
                                            }}
                                      />
                                  </div>
                                  <span class="form-text text-muted">We'll never share your email with anyone else.</span>
                                </div>
                              </div>
                        </div>

											
											</div>
											<div class="kt-portlet__foot">
												<div class="kt-form__actions">
													<button type="reset" class="btn btn-primary"> Search </button> &nbsp;
													<button type="reset" class="btn btn-secondary">Cancel</button>
												</div>
											</div>
										</form>

									</div>

								
								</div>
								</div>
								</div>
						
                 		




      </>
    );
  }
}
